import React from 'react';
import '../styles/project.css';

const Home = () => {
  return (

    <main class="projects-container">
    <div class="project-card">
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRmjuXJImvY1gN20U5SxJ34RIyc9d1EBnnb2Q&s" alt="Project 1" class="project-image" />
        <div class="project-content">
            <h2 class="project-title">Project Title 1</h2>
            <p class="project-description">
                Brief description of the project, highlighting key features and outcomes. 
            </p>
            <Link href="#" class="project-link">View Project</Link>
        </div>
    </div>

    <div class="project-card">
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRmjuXJImvY1gN20U5SxJ34RIyc9d1EBnnb2Q&s" alt="Project 2" class="project-image" />
        <div class="project-content">
            <h2 class="project-title">Project Title 2</h2>
            <p class="project-description">
                Brief description of the project, highlighting key features and outcomes. 
            </p>
            <Link href="#" class="project-link">View Project</Link>
        </div>
    </div>


</main>

  );
};

export default Home;
